(16, 1, '2019-09-06 12:21:00', '2019-09-06 12:21:00', '<div class=\"contact-input\">\r\n[text* fullname class:name placeholder \"Full Name\"]\r\n</div>\r\n<div class=\"contact-input\">\r\n[tel* phone class:name placeholder \"Phone\"]\r\n</div>\r\n<div class=\"contact-input\">\r\n[email* email class:name placeholder \"Email\"]\r\n</div>\r\n<div class=\"contact-input\">\r\n[text* subject class:name placeholder \"Subject\"]\r\n</div>\r\n<div class=\"contact-input\">\r\n[textarea message placeholder \"Your Message\"]\r\n</div>\r\n[submit \"SEND MESSAGE\"]\n1\nUjwal Jaglan \"[subject]\"\nUjwal Jaglan <ujwaljaglan9211@gmail.com>\nujwaljaglan.cs@gmail.com\nFrom: [fullname] \r\nPhone: [phone]\r\nEmail: [email]\r\nSubject: [subject]\r\n\r\nMessage Body:\r\n[message]\r\n\r\n\r\nThis e-mail was sent from a contact form on http://www.ujwaljaglan.com\nReply-To: [email]\n\n\n\n1\nUjwal Jaglan \"[subject]\"\nUjwal Jaglan <ujwaljaglan.cs@gmail.com>\n[email]\nHi [fullname],\r\n\r\nI have received your query about [subject].\r\nI will get in touch with you shortly,\r\neither or [phone] or on [email]\r\n\r\n-- \r\nThis e-mail was sent from Ujwal Jaglan (http://www.ujwaljaglan.com)\nReply-To: ujwaljaglan.cs@gmail.com\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nYour entered code is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Contact form', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2019-09-07 08:43:23', '2019-09-07 08:43:23', '', 0, 'http://www.ujwaljaglan.com/?post_type=wpcf7_contact_form&#038;p=16', 0, 'wpcf7_contact_form', '', 0),
